import React from 'react';

export default function TrainingListTable(props) {
  const { trainingList, openUpdateModal, deleteTrainingType, updateStatus } = props;
  return (
    <div className="table-responsive">
      <table className="display dtable w-100">
        <thead>
          <tr>
            <th>S.No</th>
            <th>Training Type Name</th>
            <th>Description</th>
            <th>Status</th>
            <th>Edit</th>
            <th>Delete</th>
          </tr>
        </thead>
        <tbody>
          <RenderRow
            openUpdateModal={openUpdateModal}
            updateStatus={updateStatus}
            deleteTrainingType={deleteTrainingType}
            trainingList={trainingList} />
        </tbody>
      </table>
    </div>
  )
}

function RenderRow(props) {
  const { trainingList, openUpdateModal, deleteTrainingType, updateStatus } = props;
  if (trainingList.length > 0) {
    return trainingList.map((data, index) => (
      <tr key={index}>
        <td>{index + 1}</td>
        <td>{data.training_type}</td>
        <td>{data.description}</td>
        <td>

          <div className="custom-control custom-switch" onClick={(event) => updateStatus(data.status, data.id)}>
            <input type="checkbox"  checked={data.status == "1" ? true : false}
              className="custom-control-input" 
              name="example" />
            <label className="custom-control-label"
              htmlFor="switch1"></label>
          </div>
        </td>
        <td>
          <button className="btn btn-action" onClick={() => openUpdateModal(data)}>
            <img src="/dms/images/edit.svg" alt="Edit" />
          </button>
        </td>
        <td>
          <button
            onClick={() => deleteTrainingType(data.id)}
            className="btn btn-action">
            <img src="/dms/images/delete.svg" alt="Delete" />
          </button>
        </td>
      </tr>
    ))
  }
  return (
    <tr>
      <td colSpan="6">No Data</td>
    </tr>
  )
}
